    function resizePlot() {

        if (chartDiv) {
            Plotly.Plots.resize(chartDiv);
        }
    }
    window.addEventListener('message', function(event) {
        if (event.data.type === 'resize-plotly') {
            resizePlot();
        }
    }, false);
    // 初期ロード時にもリサイズを試みる
    window.addEventListener('load', resizePlot);
</script></body>
</html>
